/*Table structure for table `xly_customer` */

DROP TABLE IF EXISTS `xly_customer`;

CREATE TABLE `xly_customer` (
  `CTM_ID` int(10) NOT NULL AUTO_INCREMENT,
  `CTM_NAME` varchar(20) DEFAULT NULL,
